function refresh() {
    let req = new XMLHttpRequest();
    req.onreadystatechange = function (params) {
        if (this.readyState === 4 && this.status === 200) {
            console.log(JSON.parse(this.responseText))
        }
    }
    req.open('GET', '/medications.json', true);
    req.send();
}

setInterval(() => {
    refresh()
}, 1000);
